import axios from "axios";
import React, { useEffect, useState } from "react";

const Question = () => {
  const [Questions, setQuestion] = useState([]);
  const [UpdatedQuestion, setUpdatedQuestion] = useState([]);
  const [CurrentQuestion, setCurrentQuestion] = useState(0);

  //life cycle method
  useEffect(() => {
    const getQuestion = async () => {
      try {
        const { data } = await axios.get(
          "http://localhost:5000/api/user/question/1"
        );

        if (data) {
          setQuestion(data.questions);
          console.log(data.questions);
          setUpdatedQuestion(data.questions);
        }
      } catch (error) {
        console.log(error.message);
      }
    };
    getQuestion();
    {
    }
  }, []);

  return (
    <div class="content_wraper">
      <div class="logo">
        <div class="container">
          <a target="_blank" href="https://www.inboundacademy.in/">
            <img src="images/inbound-academy-logo.webp" alt="Logo" />
          </a>
        </div>
      </div>
      <div class="body_content">
        <div class="container">
          <div class="exam_wrap">
            <div class="exam_title">
              <h1>Salesforce Administrator Certification Practice Test</h1>
            </div>
            <div class="exam_time">
              Time Remaining: &nbsp;
              <strong>
                <span id="timer"></span>
              </strong>
            </div>

            <div class="exam_qustions">
              <div class="qus_nums">01 of 50.</div>
              <div class="qus_ans">
                <div class="qustion">
                  {Questions?.[CurrentQuestion]?.question}
                </div>
                <div class="qustion_mcqs">
                  <ul type="A">
                    <li>
                      <span>
                        <input type="radio" name="ans" id="ansA" />
                        <label for="ansA">
                          How many questions are on the Salesforce admin
                          certification exam?
                        </label>
                      </span>
                    </li>
                    <li>
                      <span>
                        <input type="radio" name="ans" id="ansB" />
                        <label for="ansB">
                          What is the pass rate for Salesforce admin?
                        </label>
                      </span>
                    </li>
                    <li>
                      <span>
                        <input type="radio" name="ans" id="ansC" />
                        <label for="ansC">
                          Is the Salesforce admin certification exam hard?
                        </label>
                      </span>
                    </li>
                    <li>
                      <span>
                        <input type="radio" name="ans" id="ansD" />
                        <label for="ansD">
                          How many attempts to pass Salesforce admin exam?
                        </label>
                      </span>
                    </li>
                  </ul>
                </div>
              </div>
            </div>
            <div class="exam_qustions_btns text-right">
              <a href="#">
                <i class="fa-solid fa-angles-left"></i>&nbsp;Back
              </a>
              <a href="#">
                Next&nbsp;<i class="fa-solid fa-angles-right"></i>
              </a>
              <a href="#">Submit Exam</a>
            </div>
          </div>
        </div>
      </div>
      <footer class="text-center">
        <div class="container">
          Copyright © 2023.{" "}
          <a href="https://www.transfunnel.com/" target="_blank">
            TransFunnel Consulting
          </a>
        </div>
      </footer>
    </div>
  );
};

export default Question;
